const CompareButton = () => {
    const handleClick = () => {
        alert("Comparison Tool button clicked!");
    };

    return (
        <button onClick={handleClick} className="bg-blue-500 text-white px-4 py-2 rounded">
            Compare
        </button>
    );
};

export default CompareButton;
